import Link from "next/link";
const Navbar = ()=> (
    <nav className="navbar">
    <ul className="navbar-nav">
      <li className="nav-item">

      </li>
    </ul>
    <style jsx>
      {`
      .navbar{
        width: 5rem;
        height: 100vh;
        position:fixed;
        background-color: #2A2E35;
      }
      `}
    </style>
  </nav>
);

export default Navbar;
